	@Test
	public void testDistanceIsSymmetric() {
		List<Taxon> taxa = new ArrayList<>();
		for (String str : taxaGopher.split(",")) {
			taxa.add(new Taxon(str));
		}
		TaxonSet taxonset = new TaxonSet();
		taxonset.initByName("taxon", taxa);

		int nonSymmetricCount = 0;
		for (int i = 0; i < treesGopher.length; i++) {
			TreeParser tree1 = new TreeParser(treesGopher[i]);
			for (int j = 0; j < treesGopher.length; j++) {
				TreeParser tree2 = new TreeParser(treesGopher[j]);
				
				RNNIMetric metric = new RNNIMetric();
				metric.initByName("taxonset", taxonset);
				double d = metric.distance(tree1, tree2);

				metric = new RNNIMetric();
				metric.initByName("taxonset", taxonset);
				double d2 = metric.distance(tree2, tree1);
				// System.err.println(i + " " + j + " " +d + " " + d2 + " " + (d2==d));
				if (d2 != d) {
					System.err.println(i + " " + j + " " +d + " " + d2 + " " + (d2==d));
					nonSymmetricCount++;
				}
				System.out.print((int)d+",");
			}
			System.out.println();
		}
		assertEquals(0, nonSymmetricCount);
	}	
	@Test
	public void testDengueTrees() {
		testSet("Dengue", taxaDengue, treesDengue, distancesDengue);
		testSet("RSV2",  taxaRSV2, treesRSV2, distancesRSV2);
		testSet("bdsky", taxaBdsky, treesBdsky, distancesBdsky);
	}
	
	private void testSet(String dataSet, String taxonNames, String [] trees, double [][] distances) {
		List<Taxon> taxa = new ArrayList<>();
		for (String str : taxonNames.split(",")) {
			taxa.add(new Taxon(str));
		}
		TaxonSet taxonset = new TaxonSet();
		taxonset.initByName("taxon", taxa);

		int nonSymmetricCount = 0;
		for (int i = 0; i < trees.length; i++) {
			TreeParser tree1 = new TreeParser(trees[i]);
			for (int j = 0; j < trees.length; j++) {
				TreeParser tree2 = new TreeParser(trees[j]);
				
				RNNIMetric metric = new RNNIMetric();
				metric.initByName("taxonset", taxonset);
				double d = metric.distance(tree1, tree2);

				metric = new RNNIMetric();
				metric.initByName("taxonset", taxonset);
				double d2 = metric.distance(tree2, tree1);
				if (d != d2 || distances[i][j] != d) {
					System.err.println(dataSet + " " + i + " " + j + " " + distances[i][j] + " " +d + " " + d2 + " " + (distances[i][j]- d) + " " + (d2==d));
					nonSymmetricCount++;
				}
			}
		}
		assertEquals(0, nonSymmetricCount);
	}
	
	
